INSERT INTO `trips` (`Id`, `Name`, `FromAirportId`, `ToAirportId`, `HotelId`, `DepartureDate`, `ArrivalDate`, `PriceForAdult`, `PriceForChild`, `IsLastMinute`, `IsFirstMinute`, `NumberOfBooking`, `Description`, `IsPublic`, `ImageData`) VALUES
(3, 'Wakacje w Paryżu', 1, 3, 2, '2024-02-10', '2024-02-15', '1500.000000000000000000000000000000', '1000.000000000000000000000000000000', 1, 0, 30, 'Odkryj niepowtarzalny urok Paryża podczas naszych wymarzonych wakacji! Nasza oferta wakacyjna to podróż pełna romantyzmu, sztuki i niezapomnianych widoków. Podziwiaj majestatyczną Wieżę Eiffla o zachodzie słońca, przechadzaj się malowniczymi bulwarami nad Sekwaną i odkrywaj tajemnicze zakątki Luwru. Zarezerwuj z nami, aby skosztować wykwintnej kuchni francuskiej w urokliwych kawiarniach Montmartre i zanurzyć się w atmosferze miłości, jaką oferuje nam miasto świateł. Poczuj magię Paryża podczas niezapomnianych wakacji z naszym biurem podróży!', 1, );
INSERT INTO `trips` (`Id`, `Name`, `FromAirportId`, `ToAirportId`, `HotelId`, `DepartureDate`, `ArrivalDate`, `PriceForAdult`, `PriceForChild`, `IsLastMinute`, `IsFirstMinute`, `NumberOfBooking`, `Description`, `IsPublic`, `ImageData`) VALUES
(4, 'Wycieczka do Madrytu', 5, 4, 3, '2024-02-15', '2024-02-25', '3000.000000000000000000000000000000', '1500.000000000000000000000000000000', 1, 0, 20, 'Odkryj pulsującą energię i bogactwo kultury hiszpańskiej podczas naszych ekscytujących wakacji w Madrycie! Nasza oferta wakacyjna to podróż pełna smaków, tańca i fascynujących zabytków. Zwiedzaj historyczne miejsca, takie jak Królewski Pałac i Plac Puerta del Sol, a potem relaksuj się w parku Retiro. Skosztuj autentycznych tapas w tradycyjnych hiszpańskich tawernach, tańcz flamenco w jednym z urokliwych klubów lub uczestnicz w barwnym festiwalu. Madryt oferuje niezwykłe przeżycia dla każdego gustu! Zarezerwuj z nami, aby doświadczyć tego dynamicznego miasta, gdzie nowoczesność splata się z tradycją, tworząc niezapomniane wakacje!', 1, );
INSERT INTO `trips` (`Id`, `Name`, `FromAirportId`, `ToAirportId`, `HotelId`, `DepartureDate`, `ArrivalDate`, `PriceForAdult`, `PriceForChild`, `IsLastMinute`, `IsFirstMinute`, `NumberOfBooking`, `Description`, `IsPublic`, `ImageData`) VALUES
(5, 'Wycieczka na Wenecję', 5, 2, 1, '2024-02-20', '2024-02-27', '2500.000000000000000000000000000000', '1250.000000000000000000000000000000', 1, 0, 25, 'Zaplanuj wyjątkowe wakacje pełne romantyzmu i uroku w jednym z najpiękniejszych miejsc na świecie – w Wenecji! Nasza oferta wakacyjna obejmuje niezapomniane przeżycia, począwszy od romantycznych przejażdżek gondolą po malowniczych kanałach, aż po zwiedzanie słynnych zabytków, takich jak Plac Świętego Marka czy Pałac Dożów. Podczas pobytu w Wenecji, zanurz się w unikalnej atmosferze tego magicznego miasta, delektując się kulinarnymi rozkoszami włoskiej kuchni i odkrywając ukryte zakątki, które uczynią Twoje wakacje niezapomnianymi. Zarezerwuj teraz, by doświadczyć magii Wenecji razem z nami!', 1, );
INSERT INTO `trips` (`Id`, `Name`, `FromAirportId`, `ToAirportId`, `HotelId`, `DepartureDate`, `ArrivalDate`, `PriceForAdult`, `PriceForChild`, `IsLastMinute`, `IsFirstMinute`, `NumberOfBooking`, `Description`, `IsPublic`, `ImageData`) VALUES
(6, 'Wakacje w Sharm el Sheikh', 5, 6, 4, '2024-02-29', '2024-03-05', '3000.000000000000000000000000000000', '1500.000000000000000000000000000000', 1, 0, 18, 'Odkryj rajski azjatycki kurort podczas naszych luksusowych wakacji w Sharm el Sheikh! Usytuowane nad kryształowo czystym Morzem Czerwonym, te wspaniałe plaże, korale koralowe i egzotyczna przyroda czekają na Ciebie. W ciągu dnia nurkuj w fascynującym świecie podwodnym, eksploruj rafy koralowe, a wieczorem podziwiaj zachody słońca nad Saharą. Nasza oferta wakacyjna obejmuje luksusowe hotele, wspaniałe restauracje z lokalną i międzynarodową kuchnią oraz niezapomniane atrakcje, takie jak spacer po promenadzie Naama Bay. Zarezerwuj teraz, aby doświadczyć relaksu, przygód i egzotycznego piękna Sharm el Sheikh!', 1, );
INSERT INTO `trips` (`Id`, `Name`, `FromAirportId`, `ToAirportId`, `HotelId`, `DepartureDate`, `ArrivalDate`, `PriceForAdult`, `PriceForChild`, `IsLastMinute`, `IsFirstMinute`, `NumberOfBooking`, `Description`, `IsPublic`, `ImageData`) VALUES
(7, 'Wakacje na Islandii', 5, 7, 5, '2024-03-15', '2024-03-20', '3000.000000000000000000000000000000', '1500.000000000000000000000000000000', 0, 0, 18, 'Przygotuj się na niezapomniane wrażenia podczas magicznych wakacji na Islandii! Nasza oferta wakacyjna zabierze Cię w podróż po niezwykłych krajobrazach, gdzie gejzery tańczą w rytmie natury, a lodowce błyszczą w słońcu. Odkrywaj tajemnicze jaskinie lodowe, podziwiaj zorze polarne malujące niebo w kolorach, których nie zobaczysz nigdzie indziej, i wchodź w świat islandzkiej kultury, smakując tradycyjnych potraw i relaksując się w geotermalnych źródłach. Nasze starannie zaplanowane wakacje na Islandii to unikalna okazja do połączenia się z dziką przyrodą tego fascynującego kraju. Zarezerwuj z nami, aby przeżyć niezapomnianą przygodę na lodowej wyspie!', 1, );
INSERT INTO `trips` (`Id`, `Name`, `FromAirportId`, `ToAirportId`, `HotelId`, `DepartureDate`, `ArrivalDate`, `PriceForAdult`, `PriceForChild`, `IsLastMinute`, `IsFirstMinute`, `NumberOfBooking`, `Description`, `IsPublic`, `ImageData`) VALUES
(8, 'Wakacje w Miami', 5, 8, 6, '2024-04-20', '2024-04-30', '4000.000000000000000000000000000000', '2000.000000000000000000000000000000', 0, 0, 20, 'Zaplanuj wyjątkowe wakacje pełne słońca, rozrywki i luksusu w sercu słonecznego Miami! Nasza oferta wakacyjna to mieszanka egzotycznego plażowego relaksu, pulsującego życia nocnego i fascynującej kultury artystycznej. Spędź dni na białych plażach Miami Beach, podziwiaj kolorowe graffiti w dzielnicy Wynwood Arts i baw się w jednym z luksusowych klubów South Beach. Odkryj smaki kuchni karaibskiej i latynoskiej w lokalnych restauracjach oraz ciesz się zakupami w luksusowych butikach na Ocean Drive. Zarezerwuj teraz, aby doświadczyć energii i blasku Magic City podczas niezapomnianych wakacji w Miami!', 1, );
INSERT INTO `trips` (`Id`, `Name`, `FromAirportId`, `ToAirportId`, `HotelId`, `DepartureDate`, `ArrivalDate`, `PriceForAdult`, `PriceForChild`, `IsLastMinute`, `IsFirstMinute`, `NumberOfBooking`, `Description`, `IsPublic`, `ImageData`) VALUES
(9, 'Wakacje w Nowym Jorku', 5, 9, 7, '2024-02-25', '2024-03-05', '3000.000000000000000000000000000000', '1500.000000000000000000000000000000', 1, 0, 20, 'Zaplanuj wyjątkowe wakacje w jednym z najbardziej ikonicznych miast świata - Nowym Jorku! Nasza oferta wakacyjna to podróż pełna niepowtarzalnych atrakcji, pulsującego życia miejskiego i fascynującej mieszanki kulturowej. Podziwiaj niebotyczne wieżowce Manhattanu, spaceruj po Central Parku, a wieczorem doświadcz magii Broadwayu. Skosztuj różnorodnych smaków w jednej z licznych restauracji, odkrywaj modowe trendy w SoHo i ciesz się widokiem z tarasu widokowego Empire State Building. Nowy Jork oferuje niezapomniane wrażenia na każdym kroku! Zarezerwuj z nami, aby zanurzyć się w tę ekscytującą metropolię podczas niezapomnianych wakacji!', 1, );
INSERT INTO `trips` (`Id`, `Name`, `FromAirportId`, `ToAirportId`, `HotelId`, `DepartureDate`, `ArrivalDate`, `PriceForAdult`, `PriceForChild`, `IsLastMinute`, `IsFirstMinute`, `NumberOfBooking`, `Description`, `IsPublic`, `ImageData`) VALUES
(10, 'Wycieczka do Vancouver', 5, 10, 8, '2024-03-17', '2024-03-24', '3000.000000000000000000000000000000', '1500.000000000000000000000000000000', 0, 0, 25, 'Odkryj urok i piękno przyrody podczas naszych niezwykłych wakacji w Vancouver! Nasza oferta wakacyjna to podróż pełna malowniczych krajobrazów, nowoczesnej architektury i przyjaznej atmosfery. Zwiedzaj piękny park Stanley, spaceruj brzegiem oceanu w dzielnicy Coal Harbour, a potem skieruj się w głąb gór na wycieczki po Górach Wyżynnych. Zanurz się w kulturalnej mozaice miasta, eksplorując dzielnice Gastown i Granville Island. Smakuj świeże owoce morza w jednej z lokalnych restauracji i delektuj się widokiem na Góry Skaliste. Vancouver to idealne miejsce na wakacje, łączące przyrodę i miejski styl życia. Zarezerwuj teraz, aby doświadczyć tej wyjątkowej harmonii między miastem a naturą!', 1, );

